const Header =(head)=>{
  return(
    <div>
      <h1>{head.course}</h1>
    </div>
  )
}

const content =(items)=>{
  return(
    <div>
      <p>{items.names[0]} {items.exercises[0]}</p>
      <p>{items.names[1]} {items.exercises[1]}</p>
      <p>{items.names[2]} {items.exercises[2]}</p>
    </div>
  )
}

const App =()=> {
  const course = "Half Stack application development"
  const part1 = "Fundamentals of React"
  const exercises1 = 10
  const part2 = "Using props to pass data"
  const exercises2 = 7
  const part3 = "State of a component"
  const exercises3 = 14

  return (
    <div className="App">
      <Header course={course}/>
      <p>
        {part1} {exercises1}
      </p>
      <p>
        {part2} {exercises2}
      </p>
      <p>
        {part3} {exercises3}
      </p>
      <p> Number of exercises {exercises1 + exercises2 + exercises3}</p>
    </div>
  );
}

export default App
